import { Table, Tag, Space ,Col} from 'antd';
import React from "react";
import {getFetch} from "../function/fetch";
import {BrowserRouter} from "react-router-dom";

const { Column, ColumnGroup } = Table;

export default class TicketInfoPage extends React.Component {
    constructor() {
        super();
        this.state={data:null}
        // getFetch("/ticket/all","",(rsp)=>this.setState({
        //     data:rsp
        // }))
    }

    componentDidMount() {
        getFetch("/ticket/all","",(rsp)=>{
            console.log(this.state.data)
            this.setState({
                data:rsp
            })
        })
    }

    // componentWillUnmount() {
    //     getFetch("/ticket/all","",(rsp)=>this.setState({
    //         data:rsp
    //     }))
    // }

    render() {
        return(
            <Col span={12} offset={6}>
            <Table dataSource={this.state.data}>
                <Column title="ticket name" dataIndex="ticketName" key="ticketName" />
                <Column title="price" dataIndex="price" key="price" />
                <Column title="available nums" dataIndex="availableNumbers" key="availableNumbers" />
                <Column
                    title=""
                    key="action"
                    render={(record) => (
                            <a onClick={()=>this.props.history.push("/ticket/details/"+record.tid)}>详情</a>
                    )}
                />
            </Table>
            </Col>
        );
    }
}
